import { Link } from "react-router-dom";

function DropInMenu() {
    return (
        <div id="menu">
            <Link to="/recommender"><p className="menuItem">Home</p></Link>
            <Link to="/statboard"><p className="menuItem">Statistics</p></Link>                     
            <p className="menuItem">Players</p>    
            <p className="menuItem">Contact</p>            
        </div>

    )
};

export default DropInMenu;
